import React from "react";
import Meena from "./img/meena.jpg";

const Profile = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-4">
      <div className="bg-indigo-200 shadow m-3 rounded-xl h-screen p-2">
        <div className="p-4 ">
          <img
            className=" shadow w-48 h-48 align-middle bg-green-600 border-2 border-white rounded-full mx-auto"
            src={Meena}
            alt=""
          />
          <span class="absolute bottom-0 right-0 inline-block w-3 h-3 bg-green-600 border-2 border-white rounded-full"></span>
        </div>
      </div>
      <div className="col-span-3 m-3 rounded-xl bg-gray-200 h-screen p-2">
        Info
      </div>
    </div>
  );
};

export default Profile;
